/*
* Testing the neural net models for detecting nrem3 and rem sleep stages in 
  using fitbit 5 watch data from the project https://github.com/nathanww/home-tmr
*/

const getNremAndRemModelData = (fitData) => {

    var hrHistory=[];  //buffers for historical data
    var gyroHistory=[];
    var accHistory=[];
    var hrLong=[];
    
    var nrem3Feature = [];
    var remFeature = [];
    var results = {};

    var nrem3 = {};
    var rem = {};

    for (const [i, data] of fitData.entries()) {
      if(data.hrArray) {
        
        var hrArray = data.hrArray.split(",");

        var accelxArray = data.accelx.split(",").map(Number);
        var accelyArray = data.accely.split(",").map(Number);
        var accelzArray = data.accelz.split(",").map(Number);
        var gyroxArray = data.gyrox.split(",").map(Number);
        var gyroyArray = data.gyroy.split(",").map(Number);
        var gyrozArray = data.gyroz.split(",").map(Number);

        for(const [j, hr] of hrArray) { 
          hrInt = Number.parseInt(hr);
          hrHistory.push(hrInt);
          hrLong.push(hrInt);
          accHistory.push(accelzArray[j]);
          gyroHistory.push(gyroxArray[j]);
          
          if (hrHistory.length > 240) {
            hrHistory.shift();
            gyroHistory.shift();
            accHistory.shift();

            var inData={};

            inData['Column 1']=Math.abs(accelxArray[j]);
            inData['Column 2']=Math.abs(accelyArray[j]);
            inData['Column 3']=Math.abs(accelzArray[j]);
            inData['Column 4']=Math.abs(gyroxArray[j]);
            inData['Column 5']=Math.abs(gyroyArray[j]);
            inData['Column 6']=Math.abs(gyrozArray[j]);
            inData['Column 7']=hrInt;
            inData['Column 8']=hrInt;
            inData["Column 9"]=sd2(hrHistory);
            inData["Column 10"]=sumAbs(gyroHistory)/247;
            inData["Column 11"]=sd2(accHistory);
            
            var colNum=12;

            for (var winsize=10; winsize < 120; winsize=winsize+10) {
                var move=vslice(accHistory,winsize);
                var heart=vslice(hrHistory,winsize);
            
                
                for (var slice=0; slice < move.length;slice++) {
                    inData["Column "+colNum]=heart[slice];
                    colNum++;
                    inData["Column "+colNum]=move[slice];
                    colNum++;
                }
            }

            nrem3=(nrem3Score(inData,{}));
            rem=(remScore(inData,{}));
          }
        }  
      }

      //every epoch capture the stage
      let nrem3Val = nrem3["Probability( is3=1 )"] ?? 0;
      nrem3Feature.push(nrem3Val);

      let remVal = rem["Probability( is3=1 )"] ?? 0;
      remFeature.push(remVal);
    }
    
    results.nrem3 = nrem3Feature;
    results.rem = remFeature;
    return results;
}    

