var is_missing = function (x) {
  return isNaN(x) || !isFinite(x) || x === undefined; 
};

var max_array = function(n, lst) {
  var maxval = -Infinity;
  var maxidx = 0;
  var count_miss = 0;
  
  for (var i = 0; i < n; i++) {
      if (is_missing(lst[i])) {
          count_miss++;
      }
      else if (maxval < lst[i]) {
          maxval = lst[i];
          maxidx = i;
      }
  }
  return (count_miss == n) ? -1 : maxidx;
};

function sd2(numbersArr) {
  //--CALCULATE AVERAGE--
  var total = 0;
  for(var key in numbersArr) 
     total += numbersArr[key];
  var meanVal = total / numbersArr.length;
  //--CALCULATE AVERAGE--

  //--CALCULATE STANDARD DEVIATION--
  var SDprep = 0;
  for(var key in numbersArr) 
     SDprep += Math.pow((parseFloat(numbersArr[key]) - meanVal),2);
  return  Math.sqrt(SDprep/(numbersArr.length-1));
}

function standardDeviation(values){
var avg = average(values);

var squareDiffs = values.map(function(value){
  var diff = value - avg;
  var sqrDiff = diff * diff;
  return sqrDiff;
});

var avgSquareDiff = average(squareDiffs);

var stdDev = Math.sqrt(avgSquareDiff);
return stdDev;
}

function average(data){
var sum = data.reduce(function(sum, value){
  return sum + value;
}, 0);

var avg = sum / data.length;
return avg;
}

function sumAbs(data){
var sum = data.reduce(function(sum, value){
  return sum + Math.abs(value);
}, 0);

return sum;
}


function range(start, stop, step){
  var result = [];
  for (var i=start; i < stop; i+=step){
      result.push(i);
  }
  return result;
}


function vslice(data,winsize) {
  var avg=[];
var idx= range(0,data.length,winsize);

for (var item=0; item < idx.length; item++) {
  //var temp=data.slice([idx[item],idx[item]+winsize);
  var temp=data.slice(idx[item],idx[item]+winsize);
  
  if (temp.length == winsize) {
              avg.push(sd2(temp));
  }
}
  return avg
}

